import React from 'react';
import './App.css';

function App() {
    const [inputValue, setInputValue] = useState('');

  const handleInputChange = (event) => {
    setInputValue(event.target.value);
  };

  const handleClearFields = () => {
    setInputValue('');
  };


  return (
    <div className="container mt-5">

    <div className="row d-flex justify-content-center">

        <div className="col-md-7">

            <div className="card p-3 py-4">

                <div className="text-center">
                    <img src="https://i.imgur.com/JgYD2nQ.jpg" width="100" className="rounded-circle" />
                </div>

                <div className="text-center mt-3">
                    <span className="bg-secondary p-1 px-4 rounded text-white">Pro</span>
                    <h5 className="mt-2 mb-0">Ann Smith</h5>
                    <span>UI/UX Designer</span>

                    <div className="px-4 mt-1">
                        <p className="fonts">I am a seasoned UI/UX Designer with a passion for crafting intuitive and visually captivating digital experiences. With a keen eye for detail and a user-centric approach, I am consistently deliver designs that seamlessly blend aesthetics with functionality.
 </p>

                    </div>

                     <ul className="social-list">
                        <li><i className="fa fa-facebook"></i></li>
                        <li><i className="fa fa-dribbble"></i></li>
                        <li><i className="fa fa-instagram"></i></li>
                        <li><i className="fa fa-linkedin"></i></li>
                        <li><i className="fa fa-google"></i></li>
                    </ul>

                      <div>
                      <input
                        type="text"
                        value={inputValue}
                        onChange={handleInputChange}
                        placeholder="Enter text"
                      />
                      <p>Output: {inputValue}</p>
                      <button onClick={handleClearFields}>Clear</button>
                    </div>

                    <div className="buttons">

                        <button className="btn btn-outline-primary px-4">Message</button>
                        <button className="btn btn-primary px-4 ms-3">Contact</button>
                    </div>


                </div>




            </div>

        </div>

    </div>

</div>

    );
}
export default App;
